","\n","    col_factor\n","\n","\n","\n","Attaching package: ‘reshape2’\n","\n","\n","The following object is masked from ‘package:tidyr’:\n","\n","    smiths\n","\n","\n"]}],"source":["##load library\n","\n","library(tidyverse)\n","library(janitor)\n","library(skimr)\n","library(plyr)\n","library(dplyr)\n","library(lubridate)\n","library(ggplot2)\n","library(scales)\n","library(reshape2)\n"]},{"cell_type":"markdown","id":"5da50a9d","metadata":{"_cell_guid":"b13449f5-708a-494f-a1d5-bcfaf2578696","_uuid":"36eab53c-f5a6-4d45-bfc6-2fb1f4b73a28","papermill":{"duration":0.120491,"end_time":"2022-03-06T17:50:54.505976","exception":false,"start_time":"2022-03-06T17:50:54.385485","status":"completed"},"tags":[]},"source":["### 3.2 Importing the Data Sets\n","\n","On closer observation, many of the CSV files contain the same data, but are divided into different files based on splitting activity by minutes, hours or per day. Furthermore, there is a file called **dailyActivity_merged**, documenting calories, daily intensities and steps merged into one, which we will be using for convenience. We will using this file, and also the **Weight Log**, and **Sleep Log**.\n","\n"]},{"cell_type":"code","execution_count":2,"id":"122890d8","metadata":{"execution":{"iopub.execute_input":"2022-03-06T17:50:54.778655Z","iopub.status.busy":"2022-03-06T17:50:54.748399Z","iopub.status.idle":"2022-03-06T17:50:55.090042Z","shell.execute_reply":"2022-03-06T17:50:55.088601Z"},"papermill":{"duration":0.464116,"end_time":"2022-03-06T17:50:55.090223","exception":false,"start_time":"2022-03-06T17:50:54.626107","status":"completed"},"tags":[]},"outputs":[],"source":["\n","daily_activity <- read_csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyActivity_merged.csv\", show_col_types = FALSE)\n","weight_log <- read_csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/weightLogInfo_merged.csv\",show_col_types = FALSE)\n","sleep_log <- read_csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/sleepDay_me