xt/plain":["  id         date      time        calories date2      day    \n","1 1503960366 4/12/2016 12:00:00 AM 81       2016-04-12 Tuesday\n","2 1503960366 4/12/2016 1:00:00 AM  61       2016-04-12 Tuesday\n","3 1503960366 4/12/2016 2:00:00 AM  59       2016-04-12 Tuesday\n","4 1503960366 4/12/2016 3:00:00 AM  47       2016-04-12 Tuesday\n","5 1503960366 4/12/2016 4:00:00 AM  48       2016-04-12 Tuesday\n","6 1503960366 4/12/2016 5:00:00 AM  48       2016-04-12 Tuesday"]},"metadata":{},"output_type":"display_data"}],"source":["\n","# 4 data frames use a mdy-hms format and first must be separated\n","# Extra variable merges the second black space between the time and AM/PM\n","\n","weight_log <- separate(weight_log, col=date, into=c(\"date\", \"time\"), sep=\" \", extra = \"merge\")\n","sleep_log <- separate(sleep_log, col=sleep_day, into=c(\"date\", \"time\"), sep=\" \", extra = \"merge\")\n","hourly_steps <- separate(hourly_steps, col=activity_hour, into=c(\"date\", \"time\"), sep=\" \", extra = \"merge\")\n","hourly_cal <- separate(hourly_cal, col=activity_hour, into=c(\"date\", \"time\"), sep=\" \", extra = \"merge\")\n","\n","# Now we can change the date formats and add it as a new column \n","\n","daily_activity$date2 <- mdy(daily_activity$activity_date)\n","weight_log$date2 <- mdy(weight_log$date)\n","sleep_log$date2 <- mdy(sleep_log$date)\n","hourly_steps$date2 <- mdy(hourly_steps$date)\n","hourly_cal$date2 <- mdy(hourly_cal$date)\n","\n","# Adding a weekday column \n","\n","daily_activity$day <- weekdays(daily_activity$date2)\n","weight_log$day <- weekdays(weight_log$date2)\n","sleep_log$day <- weekdays(sleep_log$date2)\n","hourly_steps$day <- weekdays(hourly_steps$date2)\n","hourly_cal$day <- weekdays(hourly_cal$date2)\n","\n","head(daily_activity)\n","head(weight_log)\n","head(sleep_log)\n","head(hourly_steps)\n","head(hourly_cal)"]},{"cell_type":"markdown","id":"11bebd5d","metadata":{"papermill":{"duration":0.165605,"end_time":"2022-03-06T17:51:01.0794