e":"2022-03-06T17:51:04.836116","exception":false,"start_time":"2022-03-06T17:51:04.659501","status":"completed"},"tags":[]},"source":["*  The pie chart shows that on average, participants seem to spend most of their time sedentary, followed by lightly active, very active and then fairly active. \n","*  This may be due to the fact that a lot of people work in sedentary jobs, and generally spend most time sitting, but it is important to note that time spent sleeping is also included in it. \n","*  Lightly active could account for general walking.\n","*  Interestingly, the very active category is slightly larger than the fairly active category. A possible reason for this may be when people exercise, they may tend to push themselves further.\n","* Above, I have calculated that the mean time spent active per day is 38 mins. This is consistent with [CDC guidelines](https://www.cdc.gov/physicalactivity/basics/adults/) which recommends a minimum of 30 minutes of moderate intensity aerobic exercise a day.\n"]},{"cell_type":"markdown","id":"9d8d7ed2","metadata":{"papermill":{"duration":0.178248,"end_time":"2022-03-06T17:51:05.195117","exception":false,"start_time":"2022-03-06T17:51:05.016869","status":"completed"},"tags":[]},"source":["#### 4.1.2 Average Steps Per Day \n","\n","I will analyse the data to see which days people tend to be more active."]},{"cell_type":"code","execution_count":14,"id":"19b5fd19","metadata":{"execution":{"iopub.execute_input":"2022-03-06T17:51:05.556478Z","iopub.status.busy":"2022-03-06T17:51:05.554857Z","iopub.status.idle":"2022-03-06T17:51:05.598485Z","shell.execute_reply":"2022-03-06T17:51:05.596818Z"},"papermill":{"duration":0.225602,"end_time":"2022-03-06T17:51:05.598637","exception":false,"start_time":"2022-03-06T17:51:05.373035","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 7 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>day</th><th scope=col>average_steps</th></tr