;int&gt; | percent &lt;chr&gt; |\n","|---|---|---|\n","| High Use     | 12 | 50.00% |\n","| Light Use    |  9 | 37.50% |\n","| Moderate Use |  3 | 12.50% |\n","\n"],"text/plain":["  tracker_use  count percent\n","1 High Use     12    50.00% \n","2 Light Use     9    37.50% \n","3 Moderate Use  3    12.50% "]},"metadata":{},"output_type":"display_data"}],"source":["# Summarising data\n","\n","day_use <- filtered_activity %>%\n","# Counting occurances of ID to show days used\n","group_by(id) %>%\n","  dplyr::summarise(days_used=sum(n())) %>%\n","# Adding another column to show how often tracker is used by each person\n","mutate(tracker_use = case_when(\n","    days_used <= 10 ~ \"Light Use\",\n","    days_used >= 11 & days_used <= 20 ~ \"Moderate Use\", \n","    days_used >= 21 & days_used <= 31 ~ \"High Use\" )) \n","head(day_use)\n","\n","\n","# Using tracker use to then summarise how many times each category occurs\n","day_use <- day_use %>%\n","group_by(tracker_use)%>%\n","  dplyr::summarise(count=sum(n())) %>%\n","# Change the percent column to display actual percent rather than total\n","mutate(percent =count/sum(count)) %>%\n","# Add percentage (*100)\n","mutate(percent = scales::percent(percent, accuracy = 0.01))\n","View(day_use)\n","\n","day_night_use <- activity_sleep %>%\n","group_by(id) %>%\n","  dplyr::summarise(days_used=sum(n())) %>%\n","mutate(tracker_use = case_when(\n","    days_used <= 10 ~ \"Light Use\",\n","    days_used >= 11 & days_used <= 20 ~ \"Moderate Use\", \n","    days_used >= 21 & days_used <= 31 ~ \"High Use\" )) \n","head(day_night_use)\n","\n","day_night_use <- day_night_use %>%\n","group_by(tracker_use)%>%\n","  dplyr::summarize(count=sum(n())) %>%\n","# Change the percent column to display actual percent rather than total\n","mutate(percent =count/sum(count)) %>%\n","# Add percentage (*100)\n","mutate(percent = scales::percent(percent, accuracy = 0.01))\n","View(day_night_use)"]},{"cell_type":"code","execution_count":21,"id":"d5aea