r(id))) +\n","  geom_line(aes(color=as.factor(id)))+\n","  geom_point(size=2) + xlab(\"Date\") + ylab(\"Weight\") +\n","  scale_color_manual(values=c('#e69138','#674ea7', '#56B4E9',\"#38761d\",\n","                              \"#aa6318\", \"blue\", \"#3a8695\", \"#b70673\")) +\n","  labs(title=\"Weight Tracker for Participants Over Time\")\n","\n"]},{"cell_type":"markdown","id":"5cf97f62","metadata":{"papermill":{"duration":0.245423,"end_time":"2022-03-06T17:51:18.903744","exception":false,"start_time":"2022-03-06T17:51:18.658321","status":"completed"},"tags":[]},"source":["*  Only 8 out of 30 participants used the weight function, showing it wasn't a popular tool on their devices. Out of those 8, from the BMI indicator, 2 were considered to be of normal weight, with the other 6 being classed as overweight. However, without taking into account body fat, the BMI tool is only an indicator.\n","*  Out of the 8 who used it, 2 were measuring daily, 1 was measuring weekly, and the others were either measuring inconsistently, or gave up completely.\n","*  Only 1 person managed to change their weight by 1kg over the timeframe. However, without knowing whether the goals of the participants is to lose, gain or maintain weight, we can't really use this to gauge if this tool is successful. \n"]},{"cell_type":"markdown","id":"d5a2497b","metadata":{"papermill":{"duration":0.248342,"end_time":"2022-03-06T17:51:19.405677","exception":false,"start_time":"2022-03-06T17:51:19.157335","status":"completed"},"tags":[]},"source":["#### 4.2.2 Do participants who use the weight function tend to be more active?\n","\n","To do this, we will explore the average sedentary minutes of those who use the weight function, and compare that to those who don't."]},{"cell_type":"code","execution_count":27,"id":"a02029c5","metadata":{"execution":{"iopub.execute_input":"2022-03-06T17:51:20.13778Z","iopub.status.busy":"2022-03-06T17:51:19.910528Z","iopub.status.idle":"2022-03-06T17:51:20.22582Z","shell.e