"display_data"}],"source":["sleep_log$hours_slept <- sleep_log$total_minutes_asleep/60\n","ggplot(sleep_log, aes(hours_slept)) + \n","geom_histogram(color=\"#5C10C2\", fill=\"#C3A2EE\", binwidth=0.5) +\n","labs(title=\"Hours of Sleep Per Night for Participants\") +\n","xlab(\"Hours\") +\n","ylab(\"Number of Occurances\")\n","\n","sleep_summary <- sleep_log %>%\n","select(hours_slept) %>%\n","summary()\n","print(sleep_summary)"]},{"cell_type":"markdown","id":"62e9df6c","metadata":{"papermill":{"duration":0.233977,"end_time":"2022-03-06T17:51:23.51007","exception":false,"start_time":"2022-03-06T17:51:23.276093","status":"completed"},"tags":[]},"source":["*  Taken from the [Sleep Foundation](https://www.sleepfoundation.org/how-sleep-works/how-much-sleep-do-we-really-need#:~:text=National%20Sleep%20Foundation%20guidelines1,to%208%20hours%20per%20night.), **'National Sleep Foundation guidelines advise that healthy adults need between 7 and 9 hours of sleep per night. Babies, young children, and teens need even more sleep to enable their growth and development. People over 65 should also get 7 to 8 hours per night.'**\n","*  This Histogram gives us an idea of the sleep habits of participants. It shows that participants got between 7-7.5h of sleep on most nights, consistent with national guidelines. However this might not be true for each individual participant. Moreover, we still do not know the ages of each participant to know if they're meeting the sleep guidelines.\n","\n","\n"]},{"cell_type":"markdown","id":"b59455ee","metadata":{"papermill":{"duration":0.224082,"end_time":"2022-03-06T17:51:23.959746","exception":false,"start_time":"2022-03-06T17:51:23.735664","status":"completed"},"tags":[]},"source":["#### 4.3.2 Are the participants who track their sleep more regularly the ones who get less sleep?\n","\n","To answer this question, we will plot a scattergraph for hours slept vs the number of days each person tracked."]},{"cell_type":"code","execution_count":31,"id":"