Hours Slept By Each Participant in a Period of One Month\") +\n","xlab(\"ID\") + ylab(\"Hours Slept\")"]},{"cell_type":"markdown","id":"224d7c7d","metadata":{"papermill":{"duration":0.22807,"end_time":"2022-03-06T17:51:25.580591","exception":false,"start_time":"2022-03-06T17:51:25.352521","status":"completed"},"tags":[]},"source":["* From this data, it seems like most of the people who were stringent with tracking sleep got 6-9 hours of sleep a night - the average requirements. \n","* The lower third of the chart shows the lowest hours of sleep logged. Looking across the chart, there are 3 participants whose sleep times more or less all fell within this lower third (1644430081, 2320127002, 4702921684). However, these participants also did not track more than a few days a month. It is also possible that the reason their total hours slept were low, was that perhaps they were taking their devices off during the night.\n","* One participant, 1503960366, tracked consistenly, but averaged slightly less sleep than many others tracking consistenly, and less than national guidelines. It is not possible to say what factors contribute towards this.\n","* Overall it seems that there is no discernable trend between lower sleep times and tracking."]},{"cell_type":"markdown","id":"3e1e8215","metadata":{"papermill":{"duration":0.229022,"end_time":"2022-03-06T17:51:26.041131","exception":false,"start_time":"2022-03-06T17:51:25.812109","status":"completed"},"tags":[]},"source":["### 4.4 Sleep Vs Activity"]},{"cell_type":"markdown","id":"3d483972","metadata":{"papermill":{"duration":0.228112,"end_time":"2022-03-06T17:51:26.496919","exception":false,"start_time":"2022-03-06T17:51:26.268807","status":"completed"},"tags":[]},"source":["Here I will use the previously merged activity and sleep table to discern if there is any correlation between active minutes and hours slept. I will **not** be using the sedentary_minutes column, as sedentary_minutes *includes* sleep itself. "]},{"cell_typ